import React from 'react'
import classes from './MealItem.module.css'

export const MealItem = (props) => {
    const price = `$${props.price.toFixed(2)}`;

    return (
        <li>
            <div>
                <h3>{props.name}</h3>
                <div>{props.description}</div>
                <div>{props.price}</div>
            </div>
        </li>
    )
}
